(56, 'Advanced Python Programming', 'Discover the power of Python, one of the most popular and versatile programming languages. This course covers everything from the basics of programming to advanced topics like data analysis, web development, and automation. Whether you\'re a beginner or looking to enhance your skills, you\'ll gain hands-on experience with real-world projects. Perfect for students, professionals, and aspiring developers!', NULL, NULL, 200.00, 10, 1, 11, '2024-12-14 05:00:11', '2024-12-14 05:01:52', 4, 2, 'Learn Python: Master the Basics to Advanced Concepts', '[\"Coding Basic\", \"Python Data Structure\", \"Django\"]'),
(57, 'Digital Art', 'Unleash your creativity with our Digital Art Class! Learn the fundamentals of digital illustration, painting, and design using industry-standard tools. Whether you\'re a beginner or looking to refine your skills, this class will guide you in creating stunning digital masterpieces. Perfect for aspiring artists, designers, and creators!', NULL, '/storage/course_images/K3Mo8gqsAc7jkR7n9S1NaPB7MbMXXmjmJ3NN7HHv.jpg', 50.00, 6, 1, 11, '2024-12-14 11:40:02', '2024-12-14 11:40:29', 3, 3, 'Unleash your creativity with our Digital Art Class!', '[\"Design\", \"Color Theory\", \"Potrait\", \"Design\"]'),
(60, 'Mastering Digital Marketing: From Basics to Advanced Strategies', 'In this comprehensive digital marketing course, you will journey through the fundamental principles and advanced strategies that make for an effective digital marketing campaign. Starting with the basics of SEO, content marketing, and social media, you\'ll gradually delve into complex topics such as data analytics, automation, and conversion rate optimization. Each module is designed to equip you with actionable insights and hands-on experience, ensuring you can apply your knowledge immediately in real-world scenarios. Whether you\'re a business owner, marketing professional, or aspiring marketer, this course will elevate your skills and help you achieve measurable success in the digital landscape.', NULL, '/storage/course_images/QEXIUR0aGxMTtqqLQHIN0O7h5uQhmywPnaN7GPm4.jpg', 100.00, 6, 1, 11, '2024-12-14 13:44:37', '2024-12-14 13:46:33', 2, 1, 'Unlock the secrets of successful digital marketing and transform your business or career. Learn the latest tools, techniques, and strategies to grow your online presence and drive sales.', '[\"SEO Fundamentals\", \"Content Marketing\", \"Data Analytics\", \"Conversion Rate Optimization\", \"Marketing Automation\"]');
