INSERT INTO `lessons` (`id`, `title`, `content`, `course_id`, `created_at`, `updated_at`) VALUES
(39, 'Python Data Structure', '<p>Discover the power of Python, one of the most popular and versatile programming languages. This course covers everything from the basics of programming to advanced topics like data analysis, web development, and automation. Whether you\'re a beginner or looking to enhance your skills, you\'ll gain hands-on experience with real-world projects. Perfect for students, professionals, and aspiring developers!</p>', 56, '2024-12-14 05:01:25', '2024-12-14 05:01:25'),
(40, 'Django', '<p>Discover the power of Python, one of the most popular and versatile programming languages. This course covers everything from the basics of programming to advanced topics like data analysis, web development, and automation. Whether you\'re a beginner or looking to enhance your skills, you\'ll gain hands-on experience with real-world projects. Perfect for students, professionals, and aspiring developers!</p>', 56, '2024-12-14 05:01:49', '2024-12-14 05:01:49'),
