(45, 'Introduction to Data Collection', '<p><strong>Content:</strong></p><ul><li>Overview of data sources (databases, web scraping, APIs)</li><li>Methods for collecting clean and relevant data</li><li>Hands-on practice with data collection tools</li></ul><p><br></p>', 60, '2024-12-14 13:45:21', '2024-12-14 13:46:01'),
(46, 'Data Cleaning and Preprocessing', '<p><strong>Content:</strong></p><ul><li>Techniques for handling missing data and outliers</li><li>Steps to normalize and standardize data</li><li>Practical exercises with real datasets</li></ul><p><br></p>', 60, '2024-12-14 13:45:47', '2024-12-14 13:46:09'),
(47, 'Basic Data Analysis', '<p><strong>Content:</strong></p><ul><li>Introduction to descriptive statistics and data visualization</li><li>How to use Python for basic data analysis</li><li>Guided project analyzing a sample dataset</li></ul><p><br></p>', 60, '2024-12-14 13:46:32', '2024-12-14 13:46:32');
